import React ,{Component} from 'react';

class StockTable extends Component {
    constructor(props) {
        super(props);

    }
    render() {
        const noOfDate=21;
        const noOfHigh=21;
        const noOfLow=21;
        const noOfClose=21;
        const noOfOpen=21;

        return(

                    <div className="container-fluid">

                        <div className="row" style={{}}>
                                            <div className="col col-sm-3" style={{border: '1px solid',padding:'10px',textAlign: 'center'}} >
                                            <h5 style={{color: 'white' ,textAlign: 'center'}}>Date</h5>
                                            <hr style={{background: "grey"}}/>
                                            {this.props.dateVal.slice(0,noOfDate).map((item) => {
                                                    return (
                                                    <div style={{color: 'aqua',padding:'9px',fontSize:"2vmin"}}>{item}</div>
                                                    )
                                                    })
                                                }
                                            </div>

                                            <div className="col" style={{border: '1px solid',padding:'10px',textAlign: 'center'}}>
                                            <h5 style={{color: 'white' ,textAlign: 'center'}}>open</h5>
                                            <hr style={{background: "grey"}}/>
                                            {this.props.openVal.slice(0,noOfOpen).map((item) => {
                                                    return (
                                                    <div style={{color: '#8d93ab', margin:'10',fontSize:"2vmin",padding: '9px'}}>{parseFloat(item).toFixed( 2 )}</div>
                                                    )
                                                    })
                                                }
                                            </div>

                                            <div className="col" style={{border: '1px solid',padding:'9px',textAlign: 'center'}}>
                                            <h5 style={{color: 'white' ,textAlign: 'center'}}>High</h5>
                                            <hr style={{background: "grey"}}/>

                                            {this.props.highVal.slice(0,noOfHigh).map((item) => {
                                                    return (
                                                    <div style={{ margin:'10',marginBottom:'100',fontSize:"2vmin",padding: '9px',color: '#8d93ab'}}>{parseFloat(item).toFixed( 2 )}</div>
                                                    )
                                                    })
                                                }
                                            </div>

                                            <div className="col" style={{border: '1px solid',padding:'9px',textAlign: 'center'}}>
                                            <h5 style={{color: 'white' }}>Low</h5>
                                            <hr style={{background: "grey"}}/>
                                            {this.props.lowVal.slice(0,noOfLow).map((item) => {
                                                    return (
                                                    <div style={{color: '#8d93ab', margin:'10',fontSize:"2vmin",padding: '9px'}}>{parseFloat(item).toFixed( 2 )}</div>
                                                    )
                                                    })
                                                }
                                            </div>

                                            <div className="col" style={{border: '1px solid',padding:'9px'}}>
                                            <h5 style={{color: 'white' ,textAlign: 'center'}}>Close</h5>
                                            <hr style={{background: "grey"}}/>
                                            {this.props.closeVal.slice(0,noOfClose).map((item) => {
                                                    return (
                                                    <div style={{color: '#8d93ab',fontSize:"2vmin",padding: '9px',textAlign: 'center'}}>{parseFloat(item).toFixed( 2 )}</div>
                                                    )
                                                    })
                                                }
                                            </div>
                                        </div>

                    </div>
        )
    }

}
export default StockTable;
